import Vue from 'vue'
import App from './App.vue'
import VueRouter from 'vue-router';

Vue.use(VueRouter);
Vue.config.productionTip = false

const routes = [

  {
    path: '/',
    name: 'home',
    component: App
  },
];
export default routes;

const router = new VueRouter({

  routes // 配置路由规则

});

new Vue({
  render: h => h(App),

}).$mount('#app')
